import { EmailValidator } from "@angular/forms";

export class Student{
    
    firstname!: String;
    lastname!: String;
    emailId!: EmailValidator;
    password!: String;
    age!: Number;
    gender!:Gender ;
    cgpa!: Number;
    degree!: Degree;
    aadhaarNo !: Number;
    passportNo!: String;
    greScore!: Number;
    ieltsScore!: Number;
    specialization!: String;

   


}
export enum Gender{
    MALE,
    FEMALE
}

export enum Degree{
    BTECH,
    BE,
    BSC
}
